DROP TABLE IF EXISTS `blacklist_detail`;
CREATE TABLE `blacklist_detail` (
  `blacklist_id` int(11) NOT NULL COMMENT '黑名单ID',
  `idnumber` varchar(200) DEFAULT NULL COMMENT '身份证号',
  `imei` varchar(100) DEFAULT NULL COMMENT 'IMEI',
  `black_time` varchar(30) DEFAULT NULL COMMENT '入黑时间',
  `black_type` varchar(30) DEFAULT NULL COMMENT '黑名单类型',
  `black_reason` varchar(30) DEFAULT NULL COMMENT '入黑原因',
  `institute_type` varchar(20) DEFAULT NULL COMMENT '机构类型',
  `institutet_name` varchar(30) DEFAULT NULL COMMENT '机构名称',
  `overdue_duration` varchar(30) DEFAULT NULL COMMENT '逾期时长',
  `overdue_time` varchar(30) DEFAULT NULL COMMENT '逾期时间',
  `overdue_amt` varchar(30) DEFAULT NULL COMMENT '逾期金额',
  `overdue_principal` varchar(30) DEFAULT NULL COMMENT '逾期本金',
  `overdue_interest` varchar(30) DEFAULT NULL COMMENT '逾期利息',
  `overdue_total` varchar(30) DEFAULT NULL COMMENT '逾期本息',
  `overdue_title` varchar(100) DEFAULT NULL COMMENT '逾期记录描述',
  `borrow_date` varchar(30) DEFAULT NULL COMMENT '借款日期',
  `borrow_amt` varchar(30) DEFAULT NULL COMMENT '借款金额',
  `borrow_periods` varchar(30) DEFAULT NULL COMMENT '借款期限',
  `repay_time` varchar(30) DEFAULT NULL COMMENT '偿还时间',
  `is_payoff` varchar(1) DEFAULT NULL COMMENT '是否还清(0-未知,1-未还清,2-已还清)',
  `court_name` varchar(50) DEFAULT NULL COMMENT '法院名称',
  `province` varchar(10) DEFAULT NULL COMMENT '所在省',
  `execbasis` varchar(10) DEFAULT NULL COMMENT '执行依据',
  `filing_time` varchar(20) DEFAULT NULL COMMENT '立案日期',
  `casecode` varchar(30) DEFAULT NULL COMMENT '案件编号',
  `execbasiscompany` varchar(30) DEFAULT NULL COMMENT '执行依据机构',
  `obligation` varchar(30) DEFAULT NULL COMMENT '责任',
  `case_state` varchar(30) DEFAULT NULL COMMENT '案件状态',
  `concreatesituation` varchar(100) DEFAULT NULL COMMENT '具体情况',
  `execorlet` varchar(2) DEFAULT NULL COMMENT '是否执行(执行或失信)',
  `exec_money` varchar(30) DEFAULT NULL COMMENT '执行金额',
  `release_time` varchar(30) DEFAULT NULL COMMENT '发布时间',
  `mark` varchar(200) DEFAULT NULL COMMENT '备注',
  `batchflag` varchar(30) DEFAULT NULL COMMENT '数据批次标记(来源_fbdl取导入日期/hbdl取提供日期_时间)',
  PRIMARY KEY (`blacklist_id`),
  KEY `idnumber` (`idnumber`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='黑名单明细';

